(()=>{var h=document.querySelectorAll('input[type="checkbox"]'),e={};h.forEach(a=>{a.addEventListener("change",function(){this.checked?(e[this.name]||(e[this.name]=[]),e[this.name].push(this.value)):e[this.name]&&(e[this.name]=e[this.name].filter(t=>t!==this.value));let n=new URLSearchParams;Object.keys(e).forEach(t=>{e[t].forEach(c=>{n.append(t,c)})});let s=window.location.pathname+"?"+n.toString();console.log(s),history.pushState(null,null,s)})});})();
